  false,\n\t\"url\": null,\n\t\"notes\": \"AML_POINT, the predecessor of COAL_AML_MISC_IN,
  is a 1:24,000-scale point-based ESRI ArcView shapefile that shows the locations
  of point features associated with Abandoned Mine Lands (AML) sites in the coal region
  of Indiana. AML_POINT includes point features from all Indiana sites listed on the
  federal AML site inventory by personnel of the Abandoned Mine Lands program of the
  Indiana Department of Natural Resources, Division of Reclamation. COAL_AML_MISC_IN
  includes point features from all Indiana sites. COAL_AML_MISC_IN includes attributes
  which allow the points to be differentiated based on point type (mine entrances,
  equipment and (or) facilities, and hazardous and (or) explosive gasses), site type,
  and site number.\",\n\t\"license_title\": null,\n\t\"extras\": [{\n\t\t\"key\":
